import React from 'react';

class Tree extends React.Component {
  state = { open: false };

  onToggle = (event) => {
    this.setState({ open: !this.state.open });
  }

  render() {
    return (
      <div>
        {members.map(member => (
          <button onClick={(event) => this.onToggle(event)}>
            {member}
          </button>
        ))}
      </div>
    )
  }
}

export default Tree;
